let totalOperationTag = [
    'commande_passage',
    'payement_evenement',
    'payement_credit',
    'modification_non_validee',
    'modification_evenement_non_validee',
    'modification_credit_non_validee',
    'annulation_non_valide',
    'annulation_valide'
]

let commandListId = [...new Set(operations.map(el => el.commandClientId))]

let operationId = 14602

let sqlScripts = commandListId.reduce((result, commandId) => {

    console.log(`FIXING COMMAND ${commandId}`)

    commandOperations = operations.filter(el => el.commandClientId == commandId)

    let total = commandOperations.reduce((result, operation) => {
        let operationType = types.find(el => el.id == operation.caisseOperationTypeId)
        return totalOperationTag.includes(operationType.tag) ? result + operation.montant : result
    }, 0)

    let payed = commandOperations.reduce((result, operation) => {
        let operationType = types.find(el => el.id == operation.caisseOperationTypeId)
        return result + (operation.montant * operationType.multiplier)
    }, 0)

    if (total != payed) console.log(`COMMAND ${commandId} NOT PAYED`)
    else console.log(`COMMAND ${commandId} PAYED`)

    if(commandOperations.length > 0) {
        let operation = commandOperations[0]
        operationId += 1
        return `${result}
        INSERT INTO \`CaisseOperation\` (\`id\`, \`localKey\`, \`montant\`, \`calendarDayEntityId\`, \`userId\`, \`caisseOperationTypeId\`, \`modePaymentId\`, \`commentaire\`, \`localCreatedAt\`, \`createdAt\`, \`updatedAt\`, \`deletedAt\`, \`fileId\`) VALUES (${operationId}, '+1-${operation.localKey}', '${total-payed}', '${operation.calendarDayEntityId}', '${operation.userId}', '4', '${operation.modePaymentId}', ' ${operation.commentaire} ', '${operation.localCreatedAt}', null, null, null, ${operation.fileId});
        INSERT INTO \`CaisseOperationCommandClient\` (\`id\`, \`caisseOperationId\`, \`commandClientId\`) VALUES (NULL, ${operationId}, ${operation.commandClientId});`
    } else {
        return result
    }

}, '');

console.log(sqlScripts)